import React from 'react';

const OtherSkills = () => {
    return (
        <div className="otherSkills">
            <h3>Autres Comp√©tences</h3>
            <div className="list">
                <ul>
                    <li><i className='fas fa-check-square'></i> Anglais</li>
                    <li><i className='fas fa-check-square'></i> github</li>
                    <li><i className='fas fa-check-square'></i> SEO</li>
                    <li><i className='fas fa-check-square'></i> Responsive</li>
                </ul>
                <ul>
                    <li><i className='fas fa-check-square'></i> MongoDB</li>
                    <li><i className='fas fa-check-square'></i> VSCode</li>
                    <li><i className='fas fa-check-square'></i> Postman</li>
                </ul>
            </div>
        </div>
    );
};

export default OtherSkills;
